import React from "react"
import styled from "styled-components"

const Header = styled.header`
	background: #273456;
	padding: 1rem 3%;

	h1 {
		text-decoration: uppercase;
	}
`

const HeaderComponent = () => {
	return (
		<Header>
			<h1>
				Books<span>OnTap</span>
			</h1>
		</Header>
	)
}

export default HeaderComponent
